import React, { useState, useEffect } from "react";
import ReactLoading from "react-loading";

const Loading = () => {
  const [loading, setLoading] = useState(false);

  const startLoading = () => {
    setLoading(true);
    setTimeout(() => {
      setLoading(false);
    }, 3000);
  };
  useEffect(() => {
    startLoading();
  }, []);

  return (
    <div>
      {loading ? (
        <ReactLoading
          type="spinningBubbles"
          color="blue"
          height={100}
          width={50}
        />
      ) : (
        
        <div>
          {/* Your page content goes here */}
        </div>
      )}
    </div>
  );
};

export default Loading;
